/* eslint-disable no-unused-vars */
import React, { lazy, Suspense } from "react";
import { Routes, BrowserRouter, Route } from "react-router-dom";

const Login = lazy(() => import("./pages/login"));

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/login" element={Login} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
